// import Heading from "../../common/Heading"
 import "./homein.css"

import RecentCard from "./HomeCard"

import { useRef, useState } from 'react';
// Import Swiper React components
import { Swiper, SwiperSlide } from 'swiper/react';

// Import Swiper styles
import 'swiper/css';
import 'swiper/css/navigation';
import 'swiper/css/pagination';

import './styles.css';
import { Navigation, Pagination, Mousewheel, Keyboard } from 'swiper/modules';


const m3="https://img.freepik.com/premium-vector/carousel-instagram-templates-banner_180271-442.jpg" ;
const m1="https://www.superthirty.com/wp-content/uploads/2023/12/what-is-gate-exaam.png"
const m2="https://d6pldk4490zsr.cloudfront.net/wp-content/uploads/2022/07/blog-banner-jee-exam-3.jpg"
const Homein = () => {
  return (
    <>


<Swiper
        cssMode={true}
        navigation={true}
        pagination={true}
        mousewheel={true}
        keyboard={true}
        modules={[Navigation, Pagination, Mousewheel, Keyboard]}
        className="mySwiper"
      >
        <SwiperSlide>Slide 1</SwiperSlide>
        <SwiperSlide>Slide 2</SwiperSlide>
        <SwiperSlide>Slide 3</SwiperSlide>
        <SwiperSlide>Slide 4</SwiperSlide>
        <SwiperSlide>Slide 5</SwiperSlide>
        <SwiperSlide>Slide 6</SwiperSlide>
        <SwiperSlide>Slide 7</SwiperSlide>
        <SwiperSlide>Slide 8</SwiperSlide>
        <SwiperSlide>Slide 9</SwiperSlide>
      </Swiper>










      <section className='recent padding'>
        <div className='container'>

          <RecentCard />
        </div>
      </section>

    </>
  )
}

export default Homein
